<!DOCTYPE html>
<html>
<style>
  
  body{
    background-color:#323232;
    overflow: visible;
    position: relative;
    perspective: 100px;
  }

  .title{
    color: whitesmoke;
    text-align: center;
  }

  .btn{
    height: 4em;
    width:fit-content;
    padding-bottom: 2em;
    padding-top: 1em;

  }

  .hidden{
    visibility: hidden;
  }

  .active{
    visibility: visible;
    transform: rotateX(5deg) translate(-5%, -5%);
    animation: mymove 3s;
  }

  .main-container{
    display: flex;
    flex-direction: row;
    justify-content: center;
    position: relative;
    perspective:275px;
  }

  .events-list{
    display: flex;
    flex-direction: row;
    width: 20vw;
    border: solid black 4px;
    background: rgb(200, 200, 200) ;
    margin-left: 2em;
    z-index: 9;
    box-shadow: 0 25px 75px rgba(0,0,0,.6);
    }

 

  .column{
    width: fit-content;
    padding: 0 1em;
  }

  .entry{
    border-bottom: solid black 1px;
    flex-wrap: wrap;
  }
  
  .map {
  position: relative;
  background: url('/Event-map/asset/2ndfloor.jpg') no-repeat;
  width: 80vw;
  height: 100vh;
  transform-style: preserve-3d;
  transform: rotateX(5deg) translate(-10%, -10%);

}

@keyframes mymove {
  from {transform: rotateX(90deg);}
  to {transform: rotateX(5deg) translate(-10%, -10%);}
}
